script: |
  super -f text -I q5509.spq | sort > q5509.out

inputs:
  - name: q5509.spq
    data: |
      SELECT DISTINCT col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( ( NOT + col1 * + col0 - - col0 * + ( col0 ) + - col1 <= + 36 ) );
  - name: tab1

outputs:
  - name: q5509.out
    data: |
      59
      68
      96
